// react-slick
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

//react
import { useState } from "react";

// icon
import { HiOutlineChevronDown, HiOutlineChevronUp } from "react-icons/hi";
import ReadMoreText from "./ReadMoreText";

function SampleNextArrow({ onClick }) {
  return (
    <div
      className="absolute max-lg:hidden hover:text-white text-indigo-600 bg-white hover:bg-indigo-600 text-xl cursor-pointer text-center left-[20%]  w-[40px] flex items-center shadow-lg justify-center rounded-[50%] h-[40px] -bottom-6"
      onClick={onClick}
    >
      <HiOutlineChevronDown />
    </div>
  );
}

function SamplePrevArrow({ onClick }) {
  return (
    <div
      className="absolute max-lg:hidden hover:text-white text-indigo-600 bg-white hover:bg-indigo-600 text-xl cursor-pointer text-center -top-6  w-[40px] h-[40px] shadow-lg rounded-[50%] z-20 flex items-center justify-center left-[20%]"
      onClick={onClick}
    >
      <HiOutlineChevronUp />
    </div>
  );
}
function ReadMore() {
  const [img, setImg] = useState(
    "data:image/jpeg;base64,"
  );
  const settings = {
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    vertical: true,
    verticalSwiping: true,
    beforeChange: function (currentSlide, nextSlide) {},
    afterChange: function (currentSlide) {},
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    responsive: [
      {
        breakpoint: 700,
        settings: {
          slidesToShow: 3,
          dots: false,
        },
      },
    ],
  };
  return (
    <div className="max-w-6xl mx-auto">
      <div className="flex my-16 mx-4 max-lg:flex-col max-lg:gap-16 justify-between">
        <div className="flex  gap-20 max-lg:gap-10 max-lg:mx-auto">
          <div className="relative w-[80px]   cursor-pointer">
            <Slider {...settings}>
              <div
                className="border"
                onClick={() =>
                  setImg(
                    "data:image/jpeg;base64,"
                  )
                }
              >
                <img
                  className=""
                  src="data:image/jpeg;base64,"
                  alt=""
                />
              </div>
              <div
                className="border"
                onClick={() =>
                  setImg(
                    "data:image/jpeg;base64,"
                  )
                }
              >
                <img
                  className=""
                  src="data:image/jpeg;base64,"
                  alt=""
                />
              </div>
              <div
                className="border"
                onClick={() =>
                  setImg(
                    "data:image/jpeg;base64,"
                  )
                }
              >
                <img
                  className=""
                  src="data:image/jpeg;base64,"
                  alt=""
                />
              </div>
              <div
                className="border"
                onClick={() =>
                  setImg(
                    "data:image/jpeg;base64,"
                  )
                }
              >
                <img
                  className=""
                  src="data:image/jpeg;base64,"
                  alt=""
                />
              </div>
              <div
                className="border"
                onClick={() =>
                  setImg(
                    "data:image/jpeg;base64,"
                  )
                }
              >
                <img
                  className=""
                  src="data:image/jpeg;base64,"
                  alt=""
                />
              </div>
            </Slider>
          </div>
          <div className="w-[400px] max-md:w-[200px] overflow-hidden  h-[370px]">
            <img className=" h-[370px]" src={img} alt="" />
          </div>
        </div>
        <div>
          <ReadMoreText />
        </div>
      </div>
      <div className="mb-8 max-lg:mx-4">
        <div role="tablist" className="tabs tabs-lifted">
          <input
            type="radio"
            name="my_tabs_2"
            role="tab"
            className="tab"
            aria-label="1"
          />
          <div
            role="tabpanel"
            className="tab-content bg-base-100 border-base-300 rounded-box p-6"
          >
            content 1
          </div>

          <input
            type="radio"
            name="my_tabs_2"
            role="tab"
            className="tab"
            aria-label="2"
            checked
          />
          <div
            role="tabpanel"
            className="tab-content bg-base-100 border-base-300 rounded-box p-6"
          >
            content 2
          </div>

          <input
            type="radio"
            name="my_tabs_2"
            role="tab"
            className="tab"
            aria-label="3"
          />
          <div
            role="tabpanel"
            className="tab-content bg-base-100 border-base-300 rounded-box p-6"
          >
            content 3
          </div>
          <input
            type="radio"
            name="my_tabs_2"
            role="tab"
            className="tab"
            aria-label="4"
          />
          <div
            role="tabpanel"
            className="tab-content bg-base-100 border-base-300 rounded-box p-6"
          >
            content 4
          </div>
        </div>
      </div>
    </div>
  );
}

export default ReadMore;
